import React, { useEffect } from 'react'

export default function Function() {
  let GetNews =()=>{
    const data =  fetch("https://newsapi.org/v2/top-headlines?sources=techcrunch&apiKey=28a2c6b3aa1945c2afd8012e42fdac9e")
    const jsondata =  data.json()
    console.log(jsondata)

  }
  useEffect(()=>{
    GetNews()
  })
  return (
    <div>Function</div>
  )
}
